Coordinador en colecta de campo em cuatro subproyectos:
1. Adaptações Sócio-Culturais de Caboclos no Estuário Amazônico do Brasil para eventos extremos de maré;
2. Impacto e adaptação da população ribeirinha amazônica às mudanças climáticas no estuário paraense;
3. Formal and informal practices of natural resource use and management in the Amazon;
4. Manejo de açaí e legalização dos acordos de pesca na região do estuário do Pará
